/** @format */

import Navbar from './Components/Navbar/Home_Navbar.js';
import Home from './Components/Home/Home.js';
import { Scrollbars } from 'react-custom-scrollbars-2';

function App() {
  return (
    <>
      <Scrollbars
        style={{
          width: 1365,
          height: 620,
        }}
      renderView>
        <Navbar />
        <Home />;
      </Scrollbars>
    </>
  );
}

export default App;
